class Solution(object):
    def countRectangles(self, rectangles, points):
        rectangles.sort(reverse=True)
        query =[]
        for i,(x,y) in enumerate(points):
            query.append((x,y,i))
        query.sort(reverse=True)
        dp =[0]*102
        ans = [0]* len(points)
        idx =  0
        for px,py,i in query:
            while idx < len(rectangles) and rectangles[idx][0] >= px:
                for j in range(rectangles[idx][1]+1):
                    dp[j] +=1
                idx  +=1
            ans[i] = dp[py]
        return ans
         
    

